import { StyleSheet, Text, View } from 'react-native'
import React from 'react'

const RulesScreen = ({ navigation }) => {
  return (
    <View>
      <Text>Rules</Text>
    </View>
  )
}

export default RulesScreen

const styles = StyleSheet.create({})
